<script lang="ts">
    import { onDestroy, onMount } from 'svelte';
    import { GrandDataDistributor } from '$lib';
    import { showcaseStateCounter, showcasingStates } from '$lib/stores/state';

    let boot: SVGGElement = $state();              // 0
    let connectedToGS: SVGGElement = $state();     // 1
    let system_check: SVGGElement = $state();      // 2
    let idle: SVGGElement = $state();              // 3
    let pre_charge: SVGGElement = $state();        // 4
    let active: SVGGElement = $state();            // 5
    let demo: SVGGElement = $state();              // 6
    let levitating: SVGGElement = $state();        // 7
    let accelerating: SVGGElement = $state();      // 8
    let cruising: SVGGElement = $state();          // 9
    let braking: SVGGElement = $state();           // 10
    let discharge: SVGGElement = $state();         // 11
    let charging: SVGGElement = $state();          // 12
    let fault: SVGGElement = $state();             // 13
    let allStates: SVGGElement[];

    const storeManager = GrandDataDistributor.getInstance().stores;
    const fsmState = storeManager.getWritable("FSMState");

    function turn_on(state:SVGGElement, index: number) {
        if (!state || !state.style) return;
        if (index == 13) {
            if (!fault_blinker_on) {
                state.style.fill = 'none'
            } else {
                state.style.fill = '#D61111';
            }
        } else {
            state.style.fill = '#0EA774'
        }
    }

    function turn_off_all(states:SVGGElement[]) {
        states.forEach(s => {
            if (!s || !s.style) return;
            s.style.fill = 'none'
        });
    }

    let interval: NodeJS.Timeout;
    let interval_fault: NodeJS.Timeout;
    let fault_blinker_on: boolean = true;

    onMount(() => {
        allStates = [
            boot,
            connectedToGS,
            system_check,
            idle,
            pre_charge,
            active,
            demo,
            levitating,
            accelerating,
            cruising,
            braking,
            discharge,
            charging,
            fault
        ]

        interval = setInterval(() => {
            turn_off_all(allStates);

            if ($showcasingStates) {
                turn_on(allStates[$showcaseStateCounter], $showcaseStateCounter);
            } else {
                turn_on(allStates[$fsmState.value % allStates.length], $fsmState.value);
            }
        }, 100)

        interval_fault = setInterval(() => {
            fault_blinker_on = !fault_blinker_on;
        }, 200)
    })

    onDestroy(() => {
        clearInterval(interval)
        clearInterval(interval_fault)
    });
</script>

